import React from 'react';
import {Typography, Card, CardContent, CardMedia ,} from '@mui/material'
import { makeStyles } from '@mui/styles';
import AccessTimeIcon from '@mui/icons-material/AccessTime';
const useStyles = makeStyles(theme => ({
    wrapIcon: {
      verticalAlign: 'middle',
      display: 'inline-flex'
     }
  })); 

function Cards(props) {
    const classes=useStyles()
    return (
        <div>
            <Card  sx={{ maxWidth: 284 }}>
     <CardMedia 
      component="img"
      height="292"
      image={props.imag} />
     <CardContent>
       <Typography style={{
        fontFamily:'Cera Pro',
        fontSize: '18px',
        fontStyle: 'normal',
        fontWeight: '700',
        lineHeight: '23px',
        letterSpacing: '0em',
        textAlign: 'left'}} variant="subtitle1">{prop.name}</Typography>
        <Typography  style={{
            fontFamily:'Cera Pro',
            fontSize: '16px',
            fontStyle: 'normal',
            fontWeight: '400',
            lineHeight: '20px',
            letterSpacing: '0em',
            textAlign: 'left'}} variant="body1">
        Erica Keswin
        </Typography>
        <Typography variant="caption" style={{
          fontFamily:'Cera Pro',
          fontSize: '14px',
          fontStyle: 'normal',
          fontWeight: '400',
          lineHeight: '18px',
          letterSpacing: '0em',
          textAlign: 'left'
}} className={classes.wrapIcon} >
    <AccessTimeIcon /> 
            13 minute read
        </Typography>
     </CardContent>
    </Card>
        </div>
    );
}

export default Cards;
